"use strict";(self.webpackChunkmy_blog=self.webpackChunkmy_blog||[]).push([[1477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"aws-eks-on-kafka-vs-msk","metadata":{"permalink":"/blog/aws-eks-on-kafka-vs-msk","source":"@site/blog/2022-11-20-[AWS EKS] AWS EKS on Kafka vs MSK.md","title":"Amazon EKS on Kafka vs MSK","description":"aws eks on kafka vs msk","date":"2022-11-20T00:00:00.000Z","formattedDate":"2022\ub144 11\uc6d4 20\uc77c","tags":[{"label":"AWS","permalink":"/blog/tags/aws"},{"label":"EKS","permalink":"/blog/tags/eks"},{"label":"K8S","permalink":"/blog/tags/k-8-s"},{"label":"kubernetes","permalink":"/blog/tags/kubernetes"},{"label":"docker","permalink":"/blog/tags/docker"},{"label":"kafka","permalink":"/blog/tags/kafka"},{"label":"msk","permalink":"/blog/tags/msk"}],"readingTime":3.61,"hasTruncateMarker":false,"authors":[{"name":"Jaewoo Sung","title":"Maintainer of blog","url":"https://github.com/dev-owner","key":"dev-owner"}],"frontMatter":{"slug":"aws-eks-on-kafka-vs-msk","title":"Amazon EKS on Kafka vs MSK","description":"aws eks on kafka vs msk","authors":"dev-owner","keywords":["AWS","EKS","K8S","kubernetes","docker","kafka","msk"],"tags":["AWS","EKS","K8S","kubernetes","docker","kafka","msk"]},"nextItem":{"title":"docusaurus-seo","permalink":"/blog/2022/11/20/docusaurus-seo"}},"content":"Kafka\ub294 \uc774\ubca4\ud2b8 \uae30\ubc18 \uc544\ud0a4\ud14d\ucc98\ub098 MSA \ub4f1\ub4f1 \ud604\ub300 \uc544\ud0a4\ud14d\ucc98 \uba54\uc138\uc9c0 \ube0c\ub85c\ucee4\ub85c \ube7c\ub193\uc744 \uc218 \uc5c6\ub294 \uc694\uc18c\uc785\ub2c8\ub2e4.\\n\\nEKS \ub610\ud55c \ub300\ubd80\ubd84\uc758 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \ucee8\ud14c\uc774\ub108\ub85c \ubc30\ud3ec\ud558\ub294 \uc640\uc911\uc5d0 \uac70\uc758 \ud544\uc218\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 \ucfe0\ubc84\ub124\ud2f0\uc2a4\ub97c \ubcf4\ub2e4 \ub354 \ud3b8\ub9ac\ud558\uac8c \uc0ac\uc6a9\ud560 \ub54c \ub9ce\uc774 \uc0ac\uc6a9\ud558\ub294 \uc694\uc18c\uc785\ub2c8\ub2e4.\\n\\n\uadf8\ub7ec\uba74 Kafka\ub97c EKS\uc5d0 \uc62c\ub824\uc11c \uc0ac\uc6a9\ud558\ub294 \ucf00\uc774\uc2a4\uc5d0 \ub300\ud574 \uc5b4\ub5a4 \ubc29\ubc95\uc774 \uc788\ub294\uc9c0, \uc7a5\ub2e8\uc810\uc774 \ubb34\uc5c7\uc778\uc9c0 \uc54c\uc544\ubd05\uc2dc\ub2e4.\\n\\n## \uc5b4\ub5a4 \ubc29\ubc95\ub4e4\uc774 \uc788\uc744\uae4c?\\n\\nEKS(K8S)\uc5d0 \uce74\ud504\uce74\ub97c \ubc30\ud3ec\ud558\ub294 \ubc29\uc2dd\uc5d0\ub294 \uc5ec\ub7ec\uac00\uc9c0\uac00 \uc788\uc744 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n1. [Manage Kafka on Kubernetes: Strimzi](https://github.com/strimzi/strimzi-kafka-operator)\\n2. [Banzai Cloud](https://github.com/banzaicloud/koperator)\\n3. [Confluent](https://docs.confluent.io/operator/current/co-deploy-cfk.html)\\n4. [Bitnami Kafka Helm chart](https://artifacthub.io/packages/helm/bitnami/kafka)\\n\\n\uc704 \ubc29\uc2dd\ub4e4 \ub9d0\uace0\ub3c4 \uc5ec\ub7ec \ubc29\ubc95\ub4e4\uc774 \uc788\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4 :)\\n\\n## EKS on Kafka\uc5d0\uc11c \uc0dd\uac01\ud574 \ubcfc \uc218 \uc788\ub294 \uc810\\n\\n\uc544\ubb34\ub798\ub3c4 \uc9c1\uc811 \ud074\ub7ec\uc2a4\ud130\ub97c \uad00\ub9ac\ud558\ub2e4 \ubcf4\ub2c8 \uadf8 \uacfc\uc815\uc5d0\uc11c \ubc30\uc6b0\ub294\uac74 \ub9ce\uc744 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uadf8\ub9ac\uace0 \ubaa8\ub4e0\uac83\uc774 Admin\uc758 \ud1b5\uc81c \ud558\uc5d0 \uad00\ub9ac\ub418\ub2c8 \uc790\uc720\ub3c4\ub098 \ub514\ubc84\uae45 \ud658\uacbd \ub610\ud55c \uad00\ub9ac\ud615 \uc11c\ube44\uc2a4\ubcf4\ub2e4\ub294 \ud3b8\ud560 \ub4ef \uc2f6\uc2b5\ub2c8\ub2e4.\\n\\n\uadf8\ub7ec\ub098 \uadf8 \uc774\uc678 \ubd80\ubd84\uc5d0\uc11c\ub294 \uc81c \uc9c0\uc2dd\uc758 \ud55c\uacc4\uc778\uc9c0 \ub354 \uc88b\uc740\uc810\uc740 \uc0dd\uac01\ud558\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. \ub300\ubd80\ubd84\uc758 \ucf00\uc774\uc2a4\uc5d0\uc11c heavy lifting\ud55c \uc791\uc5c5\uc744 \ub300\uc2e0\ud574\uc8fc\ub294 \uad00\ub9ac\ud615 \uc11c\ube44\uc2a4\uac00 \ub0ab\ub2e4\ub294 \uc0dd\uac01\uc744 \ub5a8\uce60\uc218\uac00 \uc5c6\ub124\uc694..\\n\\n\uad6c\ucd95\ud558\ub294 \ub808\ud37c\ub7f0\uc2a4\ub294 \uc544\ub798\uc640 \uac19\uc740 \uc0ac\uc774\ud2b8\ub4e4\uc774 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n- https://medium.com/@JinnaBalu/kafka-cluster-on-amezon-eks-cluster-5850d67ae723\\n- https://portworx.com/run-ha-kafka-amazon-elastic-container-service-kubernetes/\\n\\n\\n## Amazon Managed Streaming for Apache Kafka(MSK)\\n\\nAWS\uc5d0\uc11c\ub294 Kafka\ub97c managed service\ub85c \uc81c\uacf5\ud558\ub294 MSK\uac00 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\uc704\uc5d0\uc11c \uc7a0\uae50 \uc598\uae30\ud588\uc9c0\ub9cc, \uc0ac\uc2e4 \ub300\ubd80\ubd84\uc758 \uc0c1\ud669\uc5d0\uc11c MSK\ub97c \uc4f0\ub294\uac8c \ub098\uc744 \uac83 \uac19\ub2e4\ub294 \uc0dd\uac01\uc785\ub2c8\ub2e4. \uc9c1\uc811 \uc124\uce58 \uc6b4\uc601\uc740 \uc5c5\ub370\uc774\ud2b8\ub098 \uad00\ub9ac \uce21\uba74\uc5d0\uc11c \uc5b4\ub824\uc6c0\uc744 \uacaa\uc744 \ud655\ub960\uc774 \ud06c\uae30 \ub54c\ubb38\uc774\uace0, Heavy lifting\uc744 \ud53c\ud560 \uc218 \uc788\uc73c\uba74 \ud53c\ud558\ub294\uac8c \ub0ab\uc9c0 \uc54a\uc744\uae4c\ub77c\ub294 \uc0dd\uac01\uc785\ub2c8\ub2e4.\\n\\n\uadf8\ub9ac\uace0 \uad00\ub9ac \uce21\uba74\uc744 \uc81c\uc678\ud558\ub354\ub77c\ub3c4, EKS\uc640 \ub2ec\ub9ac MSK\ub294 **inter-az \ub370\uc774\ud130 \uc804\uc1a1 \ube44\uc6a9\uc774 \ubb34\ub8cc**\uc774\uae30 \ub54c\ubb38\uc5d0 \uc774\ub7ec\ud55c \ubd80\ubd84\ub610\ud55c \uace0\ub824\ud574\ubcf4\uba74 \uc88b\uc2b5\ub2c8\ub2e4.\\n\\n\\n# \uacb0\ub860\\n\\n\uc544\ubb34\ub798\ub3c4 \uc694\uc998 \ub300\ubd80\ubd84\uc758 \ucf00\uc774\uc2a4\uc5d0\uc11c \uc9c1\uc811 \ud074\ub7ec\uc2a4\ud130\ub97c \uad6c\ucd95\ud574\uc11c \uc0ac\uc6a9\ud558\ub294 \uac83 \ubcf4\ub2e4\ub294 \uad00\ub9ac\ud615 \uc11c\ube44\uc2a4\ub97c \uc0ac\uc6a9\ud558\ub294\uac8c \uc5ec\ub7ec\uac00\uc9c0 \uce21\uba74\uc5d0\uc11c \ud6a8\uc728\uc131\uc774 \uc88b\uc740 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \ub2e8, \ud68c\uc0ac\uc758 \uaddc\ubaa8\uac00 \ub108\ubb34 \ucee4\uc11c On-premise\uc5d0 \uc9c1\uc811 \ud074\ub7ec\uc2a4\ud130\ub97c \uad6c\ucd95\ud574\uc11c \uad00\ub9ac\ud574\uc57c \ud558\ub294 \uc0c1\ud669\uc774\ub098 \ud68c\uc0ac\uc758 \uc0c1\ud669\uc5d0 \ub9de\ucdb0 \ud2b9\uc815 \uae30\ub2a5\uc744 \ucee4\uc2a4\ud130\ub9c8\uc774\uc9d5 \ud574\uc57c \ud558\ub294 \uc0c1\ud669 \uac19\uc740 \uacbd\uc6b0 \uc9c1\uc811 \ud574\uc57c \ud560 \uc218\ub3c4 \uc788\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4."},{"id":"/2022/11/20/docusaurus-seo","metadata":{"permalink":"/blog/2022/11/20/docusaurus-seo","source":"@site/blog/2022-11-20-docusaurus-seo.md","title":"docusaurus-seo","description":"","date":"2022-11-20T00:00:00.000Z","formattedDate":"2022\ub144 11\uc6d4 20\uc77c","tags":[],"readingTime":0,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"Amazon EKS on Kafka vs MSK","permalink":"/blog/aws-eks-on-kafka-vs-msk"},"nextItem":{"title":"\uc2e4\ub9ac\ucf58\ubc38\ub9ac\uc5d0\uc11c \ub0a0\uc544\uc628 \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \ucee8\ud37c\ub7f0\uc2a4","permalink":"/blog/review-programmers-data-engineering-conference"}},"content":""},{"id":"review-programmers-data-engineering-conference","metadata":{"permalink":"/blog/review-programmers-data-engineering-conference","source":"@site/blog/2022-11-10-programmers-data-engineering-conference.md","title":"\uc2e4\ub9ac\ucf58\ubc38\ub9ac\uc5d0\uc11c \ub0a0\uc544\uc628 \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \ucee8\ud37c\ub7f0\uc2a4","description":"\ud504\ub85c\uadf8\ub798\uba38\uc2a4 \uc2e4\ub9ac\ucf58\ubc38\ub9ac \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \ucf54\uc2a4\uc5d0\uc11c \uc8fc\ucd5c\ud55c \ucee8\ud37c\ub7f0\uc2a4 \ud6c4\uae30","date":"2022-11-10T00:00:00.000Z","formattedDate":"2022\ub144 11\uc6d4 10\uc77c","tags":[{"label":"data","permalink":"/blog/tags/data"},{"label":"data engineering","permalink":"/blog/tags/data-engineering"},{"label":"airflow","permalink":"/blog/tags/airflow"},{"label":"\uacf5\uacf5 \ub370\uc774\ud130","permalink":"/blog/tags/\uacf5\uacf5-\ub370\uc774\ud130"}],"readingTime":15.615,"hasTruncateMarker":false,"authors":[{"name":"Jaewoo Sung","title":"Maintainer of blog","url":"https://github.com/dev-owner","key":"dev-owner"}],"frontMatter":{"slug":"review-programmers-data-engineering-conference","title":"\uc2e4\ub9ac\ucf58\ubc38\ub9ac\uc5d0\uc11c \ub0a0\uc544\uc628 \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \ucee8\ud37c\ub7f0\uc2a4","description":"\ud504\ub85c\uadf8\ub798\uba38\uc2a4 \uc2e4\ub9ac\ucf58\ubc38\ub9ac \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \ucf54\uc2a4\uc5d0\uc11c \uc8fc\ucd5c\ud55c \ucee8\ud37c\ub7f0\uc2a4 \ud6c4\uae30","authors":"dev-owner","keywords":["\uc2e4\ub9ac\ucf58\ubc38\ub9ac","\ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1","\ucee8\ud37c\ub7f0\uc2a4","\ud504\ub85c\uadf8\ub798\uba38\uc2a4","data engineering","programmers"],"tags":["data","data engineering","airflow","\uacf5\uacf5 \ub370\uc774\ud130"]},"prevItem":{"title":"docusaurus-seo","permalink":"/blog/2022/11/20/docusaurus-seo"},"nextItem":{"title":"2022 Socar data meetup","permalink":"/blog/2022-socar-data-meet-up"}},"content":"### \ubc30\uacbd\\n\\n\uc81c\uac00 \ucc98\uc74c [\uc2e4\ub9ac\ucf58\ubc38\ub9ac\uc5d0\uc11c \ub0a0\uc544\uc628 \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \ucf54\uc2a4](https://school.programmers.co.kr/learn/courses/14982)\ub97c \uc54c\uac8c \ub41c \uac74 \uc544\ub798 Youtube EO Channel\uc5d0 \uc62c\ub77c\uc628 \ud55c\uae30\uc6a9\ub2d8 \uc601\uc0c1\uc744 \uc2dc\uccad\ud55c \uc774\ud6c4 \uc785\ub2c8\ub2e4. \ucd1d 3\ubd80\uae4c\uc9c0 \uc788\ub294 \uc774 \uc601\uc0c1\uc744 \ubcf4\uace0 \ub098\uc11c \uc5ec\ub7ec\uac00\uc9c0\ub85c \ub9ce\uc740 \uc0dd\uac01\uc744 \ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \ud639\uc2dc \uc544\uc9c1 \uc548\ubcf4\uc168\ub2e4\uba74 \ud55c\ubc88\ucbe4 \uac00\ubccd\uac8c \uc2dc\uccad\ud574\ubcf4\uc2dc\ub294 \uac83\ub3c4 \ucd94\ucc9c \ub4dc\ub9bd\ub2c8\ub2e4.\\n\\n![](../static/img/blog/2022-11-10-1.png)\\n\\n\\n\uae30\uc874\uc5d0 4\ub144\uc815\ub3c4 \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \uc5c5\ubb34\ub97c \ub300\uae30\uc5c5\uc5d0\uc11c \ud588\uc5c8\ub294\ub370, \ub2e4\ub978 \uacf3\uc5d0\uc11c\ub294 \uc5b4\ub5bb\uac8c \ud558\uace0 \uc788\ub294\uc9c0 \uad81\uae08\ud558\uae30\ub3c4 \ud558\uace0 \ub0b4\uac00 \uae30\uc874\uc5d0 \ubab0\ub790\ub358 \uac83\ub4e4\uc744 \ud639\uc2dc \ubc30\uc6b8 \uc218 \uc788\uc9c0 \uc54a\uc744\uae4c \ud558\uc5ec \ucf54\uc2a4\ub97c \uc2e0\uccad\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \ub4e3\uace0 \ubcf4\ub2c8 \uc5ed\uc2dc \uae30\ub300\ub97c \uc800\ubc84\ub9ac\uc9c0 \uc54a\uace0 \uac15\uc758\uac00 \ub098\ub984 \uc54c\ucc28\uac8c \ucf54\uc2a4\uac00 \uad6c\uc131\ub418\uc5b4 \uc788\uc5b4 \ub9ce\uc740 \uac78 \ubc30\uc6b8 \uc218 \uc788\uc5c8\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uc5ed\uc2dc \uc138\uc0c1\uc740 \ub113\uace0 \ubc30\uc6b8\uac83\uc740 \ub9ce\uc2b5\ub2c8\ub2e4 :)\\n\\n\uc774 \ucf54\uc2a4\ub294 2022\ub144 10\uc6d4 \uae30\uc900 \ubc8c\uc368 10\uae30\ub97c \uc6b4\uc601\ud560 \ub9cc\ud07c \uad00\ub828 \uc885\uc0ac\uc790\ubd84\ub4e4\uc774 \ub9ce\uc774 \ub4e3\uace0 \uacc4\uc2dc\uae30\ub3c4 \ud55c\ub370 \uc774\ubc88\uc5d0 \ucf54\uc2a4 \uc218\uac15\uc0dd\ub4e4 \ub300\uc0c1\uc73c\ub85c \uae30\uc6a9\ub2d8\uc774 \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 [\ucee8\ud37c\ub7f0\uc2a4\ub97c](https://school.programmers.co.kr/learn/courses/15230) \uc5f4\uc5b4\uc8fc\uc154\uc11c \ub2e4\ub140\uc628 \ud6c4\uae30\ub97c \uc791\uc131\ud574\ubcf4\ub824 \ud569\ub2c8\ub2e4.\\n\\n\\n![](../static/img/blog/2022-11-10-2.png)\\n(\ucd9c\ucc98 : https://www.linkedin.com/in/hannahhejang/)\\n\\n\\n### \ubaa9\ucc28\\n\\n\uae08\uc77c \ucee8\ud37c\ub7f0\uc2a4 \ubaa9\ucc28\uc785\ub2c8\ub2e4.\\n\\n1. Airflow \ud658\uacbd \uace0\ub3c4\ud654\ud558\uae30 ([hoyeon lee](https://www.linkedin.com/in/ACoAAB0dV2QBZEoHPDMHVUaWR3F-okOKbAsuqhQ))\\n2. \uacf5\uacf5\ub370\uc774\ud130 \uc801\uc7ac\ud558\uae30 ([Eunji Yi](https://www.linkedin.com/in/ACoAADdQHFoBvXqcwhKQG5YBRI0MNzRqGv_9j7w))\\n3. \uc2a4\ud0c0\ud2b8\uc5c5\uc5d0\uc11c \ub370\uc774\ud130\uae30\ubc18 \uc758\uc0ac\uacb0\uc815 \uad6c\uc870 \ub9cc\ub4e4\uae30 ([Minjong Kim](https://www.linkedin.com/in/ACoAAAJgCuMBC6ob4tTNYE290unr86fVRLD7blM))\\n4. \ucc38\uc11d\uc790 \ub124\ud2b8\uc6cc\ud0b9\\n\\n\\n\ube44\ub85d \uc2dc\uac04\ub300\uac00 \ud1f4\uadfc \ud6c4 \uc800\ub141\uc2dc\uac04\ub300\uc600\uc9c0\ub9cc 1\ubc88\ubd80\ud130 3\ubc88\uae4c\uc9c0 \ud765\ubbf8\ub85c\uc6b4 \uc8fc\uc81c\ub85c \uac00\ub4dd\ud588\uace0 \uc774\ub294 \ucee8\ud37c\ub7f0\uc2a4\uc5d0 \ucc38\uac00\ud560 \ucda9\ubd84\ud55c \ub3d9\uae30\ubd80\uc5ec\uac00 \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \ucc38\uc11d\uc790\uac04 \ub124\ud2b8\uc6cc\ud0b9 \uc2dc\uac04 \uac19\uc740 \uacbd\uc6b0, \uc81c\uac00 \ud55c\ubc88\ub3c4 \uacbd\ud5d8\uc774 \uc5c6\uae30 \ub54c\ubb38\uc5d0 \uc0ac\uc2e4 \ud55c\uad6d \ud2b9\uc131\uc0c1 \uc11c\uba39\uc11c\uba39\ud558\uace0 \uc5b4\uc0c9\ud55c \ubd84\uc704\uae30\uac00 \ud750\ub974\ub2e4\uac00 \ub05d\ub098\uc9c0 \uc54a\uc744\uae4c \ub9c9\uc5f0\ud55c \uc608\uc0c1\uc744 \ud558\uace0 \uc77c\ub2e8 \ub4e4\uc5b4\uac14\uc2b5\ub2c8\ub2e4.\\n\\n\\n![](../static/img/blog/2022-11-10-3.png)\\n(\ucd9c\ucc98 : https://www.linkedin.com/in/hannahhejang/)\\n\\n\\n### Airflow \ud658\uacbd \uace0\ub3c4\ud654\ud558\uae30\\n\\n\uae08\uc77c \ucee8\ud37c\ub7f0\uc2a4 \uccab\ubc88\uc9f8 \uc138\uc158\uc785\ub2c8\ub2e4. \uc3d8\uce74\uc758 [Grab](https://www.linkedin.com/in/ACoAAB0dV2QBZEoHPDMHVUaWR3F-okOKbAsuqhQ)\ub2d8\uc774 \ubc1c\ud45c\ub97c \uc9c4\ud589\ud574 \uc8fc\uc168\uc2b5\ub2c8\ub2e4.\\n\\nGKE\uc5d0\uc11c K8S\uc5d0 Airflow\ub97c \uc6b4\uc601\uc911\uc774\uc168\uace0, \ud1b5\ud569 \uc800\uc7a5\uc18c\ub85c BigQuery\ub97c \uc0ac\uc6a9\uc911\uc774\uc168\uc2b5\ub2c8\ub2e4. Airflow\ub294 \uc678\ubd80 \uc800\uc7a5\uc18c\uc5d0\uc11c BigQuery\ub85c \ub370\uc774\ud130\ub97c \uc801\uc7ac\ud560\ub54c Batch \uc791\uc5c5\uc744 \ud558\uae30 \uc704\ud574 \uc8fc\ub85c \uc0ac\uc6a9\ud588\ub124\uc694.\\n\\nAirflow \uac1c\ubc1c\ud658\uacbd\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\ub97c \ub9ce\uc774 \ub9d0\uc500 \ud574\uc8fc\uc168\uc2b5\ub2c8\ub2e4. \ucd08\uae30 \uc544\ud0a4\ud14d\ucc98\ub294 Git\uacfc \uc5f0\uacc4\ud558\uc5ec DAG \ubc84\uc804\uad00\ub9ac\uc640 \ub3d9\uc2dc\uc5d0 Airflow\uc5d0 \ubc30\ud3ec\ub418\ub294 \uad6c\uc870\ub97c \uac00\uc838\uac04 \uac83 \uac19\uad6c\uc694. \uc6b4\uc601\ud658\uacbd \ubc0f \ub2e4\ub978 \ub3d9\ub8cc\ub4e4\uacfc \ub3c5\ub9bd\uc801\uc778 \ud658\uacbd\uc744 \uad6c\ucd95\ud558\uae30 \uc704\ud574 Git Branch\ub97c \ub530\ub85c \uac00\uc838\uac00\uace0 push\ub418\uba74 buddyworks, argocd\ub97c \ud1b5\ud574 \uc804\uc6a9 airflow\uac00 \uc0dd\uc131\ub418\uc5b4 \ud14c\uc2a4\ud2b8 \ubc0f \uac80\uc99d \ud6c4 \uc6b4\uc601 merge\ub418\ub294 \uad6c\uc870\uc600\ub2e4\uace0 \ud569\ub2c8\ub2e4.\\n\\n\uc774\ub7f0 \uad6c\uc870\uc5d0\uc11c \ubc1c\uc0dd\ud588\ub358 \uc790\uc6d0 \ub0ad\ube44, \ubd88\ud3b8\ud55c \ud658\uacbd, \uae34 \ud53c\ub4dc\ubc31 \ub8e8\ud504\ub4f1\uc758 \ub9ce\uc740 \uc774\uc288\ub85c \uc778\ud574 \uac1c\ubc1c \ud658\uacbd \ud30c\uc774\ud504\ub77c\uc778\uc744 docker compose \uae30\ubc18 \ub85c\uceec \ub178\ud2b8\ubd81 \ud658\uacbd\uc73c\ub85c \uac1c\uc120\uc744 \ud588\ub2e4\uace0 \ud569\ub2c8\ub2e4. GCP Service Account\ub97c \ud1b5\ud569 \uc778\uc99d \uc218\ub2e8\uc73c\ub85c \ud65c\uc6a9\ud558\uc600\uace0, DAG Parsing Optimization\uc744 \uc704\ud574 .airflowignore\ub97c \uc801\uadf9\uc801\uc73c\ub85c \ud65c\uc6a9\ud558\uc168\ub2e4\uace0 \ud574\uc694.\\n\\n\uc774\ub7ec\ud55c \uac1c\uc120 \uad6c\uc870\ub97c \ud1b5\ud574 \ud074\ub7ec\uc2a4\ud130\ub97c \ub744\uc6b0\ub294 \uc2dc\uac04\uc744 \ub9ce\uc774 \ub2e8\ucd95\uc2dc\ud0a4\uace0 \ud53c\ub4dc\ubc31 \ub8e8\ud504\ub97c \ub2e8\ucd95\uc2dc\ucf1c \uc0dd\uc0b0\uc131\uc744 \ub9ce\uc774 \ud5a5\uc0c1\uc2dc\ud0ac \uc218 \uc788\uc5c8\ub2e4\uace0 \ud569\ub2c8\ub2e4.\\n\\n\uc774\uc5b4\uc11c \ud14c\uc2a4\ud2b8 \ud658\uacbd\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uac00 \ub098\uc654\ub294\ub370, DAG \uae30\ubcf8 \ubb38\ubc95 \ub4f1\uc744 \uccb4\ud06c\ud558\uae30 \uc704\ud574 pytest\ub97c \ud65c\uc6a9\ud558\uc168\uace0, pre commit hook\uc744 \uc0ac\uc6a9\ud558\uc168\ub2e4\uace0 \ud569\ub2c8\ub2e4. Github Action\uc5d0\uc11c \ucee8\ubca4\uc158, \ud14c\uc2a4\ud2b8, \uac80\uc99d \ub4f1\uc744 \ucd94\uac00\ub85c \uc9c4\ud589\ud588\ub2e4\uace0 \ud558\ub124\uc694.\\n\\n\uafc0\ud301\ub4e4\ub3c4 \uc5ec\ub7ec\uac00\uc9c0 \uc18c\uac1c\ud574 \uc8fc\uc168\ub294\ub370, \uadf8 \uc911\uc5d0 CleanUp DAG\ub97c \ub9cc\ub4e4\uc5b4\uc11c \uc8fc\uae30\uc801\uc73c\ub85c TI\ub098 DagRun\ub4f1\uc758 \uc815\ubcf4\ub97c \uc0ad\uc81c\ud558\uc5ec \uc804\ubc18\uc801\uc778 cluster \ubc18\uc751\uc131 \ub4f1\uc744 \ud5a5\uc0c1\uc2dc\ud0a8 \uc810\uc774 \uc778\uc0c1\uae4a\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\ubaa8\ub2c8\ud130\ub9c1, DAG \uc6b4\uc601 \uc54c\ub78c, \ubcf4\uc548 \ubc0f RBAC \uc801\uc6a9, \uc678\ubd80 \uc811\uc18d \uc815\ubcf4\uc5d0 \ub300\ud55c secret \uc800\uc7a5\uc18c \ud65c\uc6a9, gcp secret manager \uc801\uc6a9 \ub4f1 \ub9ce\uc740 \ub0b4\uc6a9\uc744 \uc598\uae30\ud574 \uc8fc\uc168\uc9c0\ub9cc \uc2dc\uac04\uc774 \ub9ce\uc9c0\ub294 \uc54a\uc740 \uad00\uacc4\ub85c \uae4a\uc774\ub294 \ub2e4\ub8e8\uc9c0 \ubabb\ud588\ub358\uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n\uc774\ud6c4 \uc704 \ub0b4\uc6a9\ub4e4\uc744 \ud3ec\ud568\ud55c \uc804\ubc18\uc801\uc778 \ub0b4\uc6a9\uc744 [SOCAR Tech Blog](https://tech.socarcorp.kr/data/2022/11/09/advanced-airflow-for-databiz.html)\uc5d0\uc11c \uc18c\uac1c\ud574 \uc8fc\uc154\uc11c \uad00\uc2ec\uc788\uc73c\uc2dc\uba74 \ud55c\ubc88 \ubcf4\uc2dc\ub294\uac78 \ucd94\ucc9c \ub4dc\ub9bd\ub2c8\ub2e4.\\n\\n\\n### \uacf5\uacf5\ub370\uc774\ud130 \uc801\uc7ac\ud558\uae30\\n\\n\uacf5\uacf5\ub370\uc774\ud130 \uc801\uc7ac\uad00\ub828\ud574\uc11c\ub294 \ubc45\ud06c\uc0d0\ub7ec\ub4dc\uc758 [Eunji Yi](https://www.linkedin.com/in/ACoAADdQHFoBvXqcwhKQG5YBRI0MNzRqGv_9j7w)\ub2d8\uc774 \ubc1c\ud45c\ud574\uc8fc\uc168\ub294\ub370\uc694, \ucc98\uc74c \uc18c\uac1c\uc5d0\uc11c NASA\uc5d0\uc11c \uc77c\ud55c \uacbd\ub825\uc774 \uc788\uc73c\uc2e0\uac8c \uc544\uc8fc \uc778\uc0c1\uae4a\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc774\ud6c4\uc5d0 \ubc45\ud06c\uc0d0\ub7ec\ub4dc\uc5d0\uc11c \uacf5\uacf5\ub370\uc774\ud130 \uc218\uc9d1 \uad00\ub828\ud574\uc11c \uace0\uad70\ubd84\ud22c\uae30\ub97c \ub9d0\uc500\ud574 \uc8fc\uc168\ub294\ub370, \ubcf8\uaca9\uc801\uc73c\ub85c \uacf5\uacf5\ub370\uc774\ud130\ub97c \uc0ac\uc6a9\ud558\uae30 \uc704\ud574 \uace0\ub824\ud574\uc57c \ud560 \uac83\ub4e4\uc774 \uc5bc\ub9c8\ub098 \ub9ce\uc740\uc9c0 \uc54c \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc800\ub294 \uc774\uc804\uc5d0 \ud55c\ubc88 \uc5c5\ubb34\uc5d0\uc11c \uacf5\uacf5\ub370\uc774\ud130 \uc218\uc9d1\uc744 \ud574\ubd24\ub294\ub370\ub3c4 \ubd88\uad6c\ud558\uace0, \uc81c\ub300\ub85c \uc5ec\ub7ec\uae30\uad00\uc758 \ub370\uc774\ud130\ub97c \uc0ac\uc6a9\ud558\uae30 \uc704\ud574 \ud544\uc694\ud55c\uac83\ub4e4\uc744 \uc774\ubc88\uc5d0 \ucc98\uc74c \uc54c\uc558\ub294\ub370\uc694, \ub300\ud45c\uc801\uc73c\ub85c \uae30\uc5b5\ub098\ub294 \uc5b4\ub824\uc6b4 \uc810\ub4e4\uc740 \uc544\ub798\uc640 \uac19\uc558\uc2b5\ub2c8\ub2e4.\\n\\n\\n    1. \uc815\uc758\uac00 \uac19\uc740 \uceec\ub7fc\uc774\ub77c\ub3c4, \ubc1c\ud589\ud558\ub294 \uae30\uad00\uc774\ub098 API\uc5d0 \ub530\ub77c \uc774\ub984\uc774 \ub2e4\ub97c \uc218 \uc788\ub2e4.\\n    2. Enum\uc73c\ub85c \uad00\ub9ac\ub418\uc5b4\uc57c \ud560 \uac83 \uac19\uc740 \uc0c1\uc218\uac12\ub4e4\uc774 \uc5ed\uc2dc \uae30\uad00\uc774\ub098 API\uc5d0 \ub530\ub77c \uc774\ub984\uc774 \ub2e4\ub97c \uc218 \uc788\ub2e4.\\n    3. API\uba85\uc138\uac00 \uc544\ub2cc 2\ubc88\uacfc \uac19\uc740 \uac12 \uac19\uc740 \uacbd\uc6b0\ub294 \ub0b4\uc6a9\uc774 \uc5b8\uc81c \ubc14\ub014\uc9c0 \ubaa8\ub978\ub2e4.\\n    4. \uac12\uc774 \uae30\uad00\uc5d0\uc11c\ub9cc \uc54c\uc544\ubcfc \uc218 \uc788\ub294 \ud2b9\uc815 \ucf54\ub4dc\ub85c \ub418\uc5b4\uc788\ub294 \uacbd\uc6b0\uac00 \ub300\ub2e4\uc218\uc774\ub2e4.\\n    5. 4\ubc88\uacfc \uac19\uc740 \ucf54\ub4dc\ub294 \ud574\ub2f9 API\ub97c \uc81c\uacf5\ud558\ub294 \uacf3\uc774 \uc544\ub2c8\ub77c \uc800 \uba40\ub9ac \uc774\uc0c1\ud55c \ub2e4\ub978 \uae30\uad00 \uc0ac\uc774\ud2b8\uc758 \uae4a\uc219\ud788 \uc228\uaca8\uc9c4 \uc5b4\ub518\uac00\uc5d0 \uc788\ub2e4.\\n    6. \uacf5\uacf5\uae30\uad00\uc5d0 \ubb38\uc758\ub294 \ud55c\uc138\uc6d4\uc774\ub2e4.\\n\\n\\n\ubc45\ud06c\uc0d0\ub7ec\ub4dc\uc5d0\uc11c\ub294 \uc704\uc758 1\ubc88~6\ubc88\uc744 \ud574\uacb0\ud558\uae30 \uc704\ud574 \uc911\uac04 Layer\ub97c \ub450\uc5b4 \uc798 \ucd94\uc0c1\ud654\ud558\uc5ec \uc0ac\uc6a9\ud558\uace0 \uacc4\uc2e0\ub2e4\uace0 \ud558\uc600\uc2b5\ub2c8\ub2e4.\\n\\n\uc0ac\uc2e4 \uc774\ub7f0 \ubd80\ubd84\uc774 \uc2e4\uc81c \ub370\uc774\ud130\ub97c \ubcf8\uaca9\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\uace0\uc790 \ud560 \ub54c \ud06c\ub098\ud070 \uc5b4\ub824\uc6c0\uc744 \uacaa\ub294 \ubd80\ubd84\uc774\uc8e0.\\n\uc774\ub7f0 \ub370\uc774\ud130 \ud45c\uc900\uacfc \uac19\uc740 \ub0b4\uc6a9\uc740 \uc774\ubbf8 \uc81c\uacf5\ud558\ub294 \uce21\uc5d0\uc11c \uad00\ub9ac\ud558\uc5ec \uc774\uc6a9\uc790\uac00 \ud3b8\ud558\uac8c \uc774\uc6a9\ud560 \uc218 \uc788\uac8c\ub054 \uad00\ub9ac\ud574\uc57c \ud55c\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. (\ub9ce\uc740 \uae30\uad00\uc5d0\uc11c \ub370\uc774\ud130\ub97c open\ud558\uace0 \uc788\ub294\uac83\uc740 \uc544\uc8fc \uae0d\uc815\uc801\uc774\uc9c0\ub9cc, \uc544\uc9c1 \uac08\uae38\uc774 \uba3c \uac83 \uac19\uc2b5\ub2c8\ub2e4)\\n\\n:::info\\n\\n[2022-11-21] \ub180\ub78d\uac8c\ub3c4 \uac1c\uc778 \uac1c\ubc1c\uc790\ubd84\uc774 \uc911\uac04 layer \ube44\uc2a4\ubb34\ub9ac\ud55c\uac78 [`github`](https://github.com/WooilJeong/PublicDataReader)\uc5d0 \uc62c\ub9b0\uac78 \ucd5c\uadfc\uc5d0 \ubc1c\uacac\ud588\uc2b5\ub2c8\ub2e4. \uad00\uc2ec\uc788\uc73c\uc2dc\uba74 \ud55c\ubc88 \ubcf4\uc2dc\ub294\uac78 \ucd94\ucc9c \ub4dc\ub9bd\ub2c8\ub2e4.\\n\\n:::\\n\\n\\n### \uc2a4\ud0c0\ud2b8\uc5c5\uc5d0\uc11c \ub370\uc774\ud130\uae30\ubc18 \uc758\uc0ac\uacb0\uc815 \uad6c\uc870 \ub9cc\ub4e4\uae30\\n\\n\ub9c8\uc9c0\ub9c9 \uc138\uc158\uc740 NOUL\uc758 [Minjong Kim](https://www.linkedin.com/in/ACoAAAJgCuMBC6ob4tTNYE290unr86fVRLD7blM)\ub2d8\uc774 \ubc1c\ud45c\ud574\uc8fc\uc168\uc2b5\ub2c8\ub2e4.\\n\\n\uc2a4\ud0c0\ud2b8\uc5c5\uc5d0\uc11c \uc5b4\ub5a4 \ubb38\uc81c\ub97c \ubc1c\uacac\ud558\uace0, \ud574\ub2f9 \ubb38\uc81c\ub97c \uadf8\ub0e5 \uc9c0\ub098\uce58\uc9c0 \uc54a\uace0 \ub370\uc774\ud130\ub97c \uae30\ubc18\uc73c\ub85c \uc758\uc0ac\uacb0\uc815\ud558\uc5ec \uac1c\uc120\ud574\ub098\uac00\ub294 \uacfc\uc815\uc744 \ub9d0\uc500\ud574 \uc8fc\uc168\uc2b5\ub2c8\ub2e4.\\n\uc77c\uc744 \ud558\ub2e4 \ubcf4\ub2c8 \ub370\uc774\ud130\uac00 \ub3d9\ub8cc\ub4e4\uc774 \uc791\uc5c5\ud558\uace0 \uc788\ub294 \ud658\uacbd\uc758 \ub370\uc774\ud130\uac00 \uc5ec\uae30\uc800\uae30 \ud30c\ud3b8\ud654 \ub418\uc5b4 \uc788\uace0, \ubc84\uc804\uc774 \ub9de\uc9c0 \uc54a\uc73c\uba70 \uc774\ub85c\uc778\ud574 \ube44\uc988\ub2c8\uc2a4 \uc784\ud329\ud2b8\uae4c\uc9c0 \ubc1c\uc0dd\ud558\ub294 \uac83\uc744 \ud30c\uc545\ud558\uc168\uace0, \uc8fc \uc5c5\ubb34 \ubd84\uc57c\uac00 \uc544\ub2d8\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0 \uc774\ub7f0\uac83\uc744 \uac1c\uc120\ud558\uae30 \uc704\ud574 \uc544\ub798\uc640 \uac19\uc740 \uacfc\uc815\uc744 \uc9c4\ud589\ud558\uc168\ub2e4\uace0 \ud569\ub2c8\ub2e4.\\n\\n\\n    1. NAS, Google Spreadsheet \uae30\ubc18 \ud30c\uc77c \uc0ac\uc6a9 \ucd94\uc801 \ud6c4 DB\uc5d0 \uc815\uaddc\ud654\ud558\uc5ec \ub370\uc774\ud130 \uc0ac\uc6a9 \ubc0f \uc815\ud569\uc131 \uce21\uba74 \uac1c\uc120\\n    2. ML \ubaa8\ub378 \ud3c9\uac00 \ucd94\ub860 \ud658\uacbd \uac1c\uc120\\n    3. S3 + Sagemaker + DB\\n    4. Inference\ub97c \ubc18\ubcf5\uc801\uc73c\ub85c \uc218\ud589\ud558\uc9c0 \uc54a\uac8c \uac1c\uc120\\n    5. \ud1b5\uc77c\ub418\uc9c0 \uc54a\uc740 \ub370\uc774\ud130 \ud0c0\uc785, \ubcc0\uc218\uba85 \ub4f1 \uc804\uc218\uc870\uc0ac \ubc0f \ud1b5\uc77c\\n    6. \uc774\ub7ec\ud55c \uc791\uc5c5\uc744 \ud1b5\ud55c \ub370\uc774\ud130 \uac00\uc2dc\uc131 \ud655\ubcf4\\n\\n\\n\uc0ac\uc2e4 \ub370\uc774\ud130\ucabd \uc5c5\ubb34\ub97c \ud558\uc2dc\ub294 \ubd84\ub4e4\uc774\ub77c\uba74 \uc544\uc2dc\uaca0\uc9c0\ub9cc, \ub2f9\uc5f0\ud788 \ud544\uc694\ud55c \uc77c\uc744 \uc5ec\ub7ec\uac00\uc9c0 \uc774\uc720\ub85c \ud558\uc9c0 \ubabb\ud558\ub294 \uacbd\uc6b0\uac00 \ub9ce\uc2b5\ub2c8\ub2e4. \uc704\uc758 \uc0ac\ub840\ub97c \ud1b5\ud574 \ubb38\uc81c\uc810 \ubc1c\uacac\ubd80\ud130 \uc758\uc0ac\uacb0\uc815\uad8c\uc790\uc640 \ub3d9\ub8cc\ub4e4\uc744 \uc124\ub4dd\ud558\ub294 \uacfc\uc815, \uac1c\uc120\ud558\ub294 \uc791\uc5c5, \uc774\ud6c4 \uc2dc\uac01\ud654\ub97c \ud1b5\ud55c \ucd94\uac00 \uac1c\uc120 \uc0ac\ud56d \ub3c4\ucd9c\uae4c\uc9c0 \ub9ce\uc740 \ubd80\ubd84\uc744 \ubc30\uc6b4 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n\\n### \ub124\ud2b8\uc6cc\ud0b9\\n\\n\ub124\ud2b8\uc6cc\ud0b9 \uac19\uc740 \uacbd\uc6b0 \uc0ac\ub78c\uc774 50\uba85 \uac00\ub7c9 \ub418\uc5b4 \uc5ec\ub7ec \ud300\uc73c\ub85c \ub098\ub204\uc5b4 \uc9c4\ud589\ud558\uc600\uc2b5\ub2c8\ub2e4. \ud300\ub9c8\ub2e4 \ubc1c\ud45c\ud558\uc2e0 \uc5f0\uc0ac\ubd84\ub4e4\uc774 10\ubd84\uc529 \ub3cc\uc544\uac00\uba70 \uc9c8\ub2f5\uc744 \ubc1b\uc544\uc8fc\uc2dc\uace0, \uc911\uac04\uc911\uac04 \uc790\uc720\ub86d\uac8c \uc8fc\ubcc0 \uc0ac\ub78c\ub4e4\ud558\uace0 \ub124\ud2b8\uc6cc\ud0b9 \ud558\ub294 \uc2dc\uac04\uc744 \uac00\uc84c\ub294\ub370, \uc11c\uba39\ud560 \uac83\uc774\ub77c\ub294 \uc608\uc0c1\uacfc \ub2e4\ub974\uac8c \ub2e4\ub4e4 \uc5c4\uccad \uc801\uadf9\uc801\uc73c\ub85c \ub124\ud2b8\uc6cc\ud0b9\uc744 \ud558\uc168\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4. (\uc21c\uac04 \uc5ec\uae30\uac00 \ud55c\uad6d\uc774 \ub9de\ub098 \uc0dd\uac01\uc774 \ub4e4\uc5c8\uc2b5\ub2c8\ub2e4 ^^;) \ub355\ubd84\uc5d0 \uc18c\uc2ec\ud55c \uc800\ub3c4 \uc870\uae08\uc529 \uc9c8\ubb38\ub3c4 \ud558\uace0 \uba85\ud568\ub3c4 \uc8fc\uace0\ubc1b\uace0 \ud588\ub358 \uac83 \uac19\ub124\uc694.\\n\\n\uc544\ub798\ub294 \uc81c\uac00 \uc8fc\ub85c \uc9c8\ubb38\ud588\ub358 \uc9c8\ubb38\uc785\ub2c8\ub2e4.\\n\\n1. (Grab\ub2d8\uc5d0\uac8c) Socar\uc5d0\uc11c airflow dev \ud658\uacbd \uad6c\uc131\ud560 \ub54c Dev\uc6a9 DW\ub294 \uc5b4\ub5bb\uac8c \uad6c\uc131\ud558\ub294\uc9c0?\\n    - (\ub2f5\ubcc0) Dev\uc6a9 DW\uac00 \ub530\ub85c \uc788\uace0 Test\ub97c \ud558\ub294 \uc0ac\ub78c\uc774 \ub370\uc774\ud130\ub97c \uadf8\ub54c\ub9c8\ub2e4 \uc784\uc758\ub85c \uad6c\uc131\ud558\uc5ec \ud14c\uc2a4\ud2b8\\n    - \uc81c\uac00 \uad81\uae08\ud588\ub358\uac74 \ub370\uc774\ud130\uac00 \ub2e4\ub978 \ub370\uc774\ud130\ub97c \ubcf5\uc7a1\ud558\uac8c \uc758\uc874\ud558\ub294 \uacbd\uc6b0\uac00 \ub9ce\uc544\uc11c \uadf8\ub7f0 \uacbd\uc6b0 \uae30\uc874 DW\uc640 \ube44\uc2b7\ud558\uac8c \uad6c\uc131\ud574\uc57c \ud558\ub294 \uacbd\uc6b0\uac00 \uc788\uace0 \uacb0\uad6d \ud6a8\uc728\uc131\uc744 \uc704\ud574 \uc6b4\uc601\ud658\uacbd\uacfc \ube44\uc2b7\ud558\uac8c \uad6c\uc131\ud574\uc57c \ud558\ub294 \uacbd\uc6b0\uac00 \ub9ce\uc740\ub370, \uc5b4\ub5bb\uac8c \ud558\uace0\uc788\ub294\uc9c0 \uad81\uae08\ud574\uc11c \uc5ec\ucb64\ubd24\uc2b5\ub2c8\ub2e4. \uc5ed\uc2dc \uc6b4\uc601\ud658\uacbd\uacfc \ube44\uc2b7\ud558\uac8c \ud558\ub294\uac74 \ub9ac\uc18c\uc2a4\uc758 \ubb38\uc81c\uac00 \uc788\uae30 \ub54c\ubb38\uc5d0 \uc791\uc5c5\uc790\uac00 \uc57d\uac04 \ud798\ub4e4\ub354\ub77c\ub3c4 \uac1c\ubcc4\ub85c \ub370\uc774\ud130\ub97c \uad6c\uc131\ud558\uc5ec \ud14c\uc2a4\ud2b8\ub97c \ud55c\ub2e4\uace0 \ud558\ub124\uc694.\\n\\n2. (Grab\ub2d8\uc5d0\uac8c) BigQuery\uc758 \uc7a5\uc810?\\n    - (\ub2f5\ubcc0) \ub300\ucda9 \ub123\uc5b4\ub3c4 \uc0ac\uc6a9\ud558\uae30 \ud3b8\ud558\uace0, \uc131\ub2a5\uc774 \uc88b\ub2e4. \ube44\uc6a9\uc740 \ubaa8\ub974\uaca0\ub2e4.\\n    - \ub300\ucda9 \ub123\uc5b4\ub3c4 \uc0ac\uc6a9\ud558\uae30 \ud3b8\ud55c\uac74 \uc81c\uac00 \uc9c1\uc811 \uacbd\ud5d8\ud574\ubcf4\uc9c0 \uc54a\uc544 \ubaa8\ub974\uaca0\uc9c0\ub9cc \uc131\ub2a5\uc740 AWS Redshift Serverless\uc640 \ubcc4 \ucc28\uc774 \uc5c6\ub294\uac8c \ubca4\uce58\ub9c8\ud06c\ub85c \ud655\uc778\ub418\uc5b4 \uc778\uc2dd\uc758 \ucc28\uc774\uac00 \uc544\ub2cc\uac00 \uc2f6\uc2b5\ub2c8\ub2e4. \ube44\uc6a9\ub3c4 AWS \ub300\ube44 BigQuery\uac00 \ube44\uc2fc \ucf00\uc774\uc2a4\uac00 \ub9ce\uc740 \uac83 \uac19\uc740\ub370 \uc0ac\uc6a9 \ud3b8\uc758\uc131\uc5d0 \ubb3b\ud600\uc11c \ub9ce\uc740 \uace0\uac1d\ub4e4\uc774 \uadf8\ub0e5 \uc0ac\uc6a9\ud558\ub294 \uac83 \uac19\uae30\ub3c4 \ud558\ub124\uc694.\\n\\n3. (\uc774\uc740\uc9c0\ub2d8\uc5d0\uac8c) \uacf5\uacf5\ub370\uc774\ud130\uc6a9 \uc911\uac04 Layer\ub97c \uc624\ud508\uc18c\uc2a4\ub85c \uacf5\uac1c\ud558\uc2e4 \uc0dd\uac01\uc740 \uc5c6\ub294\uc9c0?\\n    - (\ub2f5\ubcc0) \ud68c\uc0ac \uc815\ucc45\uc5d0 \ub530\ub77c \ud655\uc778\ud574\ubcf4\uaca0\ub2e4.\\n    - \ud68c\uc0ac \uc790\uc0b0\uc774\ub2c8 \ub2f9\uc5f0\ud788 \uc548\ub420\uac70\ub77c \uc0dd\uac01\ud558\uae34 \ud588\uc2b5\ub2c8\ub2e4..\u314e\u314e\\n\\n\\n\uc5ec\ub7ec \uc2a4\ud0c0\ud2b8\uc5c5, \uc911\uacac\uae30\uc5c5, \ub300\uae30\uc5c5\uc5d0 \ub2e4\ub2c8\uc2dc\ub294\ubd84\ub4e4\uc774 \uace8\uace0\ub8e8 \uacc4\uc168\ub358 \uac83 \uac19\uace0 \ucde8\uc5c5\uc900\ube44\uc0dd \ubd84\ub4e4\ub3c4 \uac04\ud639 \uacc4\uc168\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \ud3c9\uc18c\uc5d0 \uc790\uc8fc \uc4f0\ub358 \uc571\uc744 \uac1c\ubc1c\ud55c \ud68c\uc0ac\uc5d0\uc11c \uc624\uc2e0\ubd84\ub4e4\uc744 \ubcf4\ub2c8 \uc2e0\uae30\ud558\uae30\ub3c4 \ud558\uace0 \uc9e7\uc9c0\ub9cc \uad81\uae08\ud588\ub358 \uac83\ub4e4\uc744 \ubb3c\uc5b4\ubcf4\uba70 \uadf8\ub4e4\uc758 \uc0dd\uac01\ub3c4 \uc870\uae08\uc774\ub098\ub9c8 \ub4e4\uc5b4\ubcfc \uc218 \uc788\ub358 \uc88b\uc740 \uc2dc\uac04\uc774\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\ub124\ud2b8\uc6cc\ud0b9\uc744 1\uc2dc\uac04\uc774\ub098 \uc7a1\uc544\uc11c \ub108\ubb34 \ub9ce\uc740 \uc2dc\uac04\uc744 \uc7a1\uc740 \uac83 \uc544\ub2cc\uac00\ub77c\ub294 \uc0dd\uac01\uc744 \ud588\uc5c8\ub294\ub370, \ub9c8\uc9c0\ub9c9\uc5d0\ub294 \ub2e4\ub4e4 \uc2dc\uac04\uc774 \ubaa8\uc790\ub77c\uc11c \ud5c8\uac81\uc9c0\uac81 \uba85\ud568\ub9cc \uad50\ud658\ud558\uace0 \uc544\uc27d\uac8c \ud5e4\uc5b4\uc84c\ub358 \uac83 \uac19\ub124\uc694.\\n\\n::: info\\n\\n[2022-11-22] https://www.youtube.com/playlist?list=PLz4XWo74AOaeXlr6zxjA_24vr8qoSzxHE \ud574\ub2f9 \uc138\uc158 \ub179\ud654 \uc601\uc0c1\ub4e4\uc774 \uc5c5\ub370\uc774\ud2b8 \ub418\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n:::"},{"id":"2022-socar-data-meet-up","metadata":{"permalink":"/blog/2022-socar-data-meet-up","source":"@site/blog/2022-10-27-socar-data-meet-up.md","title":"2022 Socar data meetup","description":"2022 socar data meetup review","date":"2022-10-27T00:00:00.000Z","formattedDate":"2022\ub144 10\uc6d4 27\uc77c","tags":[{"label":"socar","permalink":"/blog/tags/socar"},{"label":"data","permalink":"/blog/tags/data"},{"label":"meetup","permalink":"/blog/tags/meetup"}],"readingTime":5.72,"hasTruncateMarker":false,"authors":[{"name":"Jaewoo Sung","title":"Maintainer of blog","url":"https://github.com/dev-owner","key":"dev-owner"}],"frontMatter":{"slug":"2022-socar-data-meet-up","title":"2022 Socar data meetup","description":"2022 socar data meetup review","authors":"dev-owner","keywords":["socar","data","meetup"],"tags":["socar","data","meetup"]},"prevItem":{"title":"\uc2e4\ub9ac\ucf58\ubc38\ub9ac\uc5d0\uc11c \ub0a0\uc544\uc628 \ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \ucee8\ud37c\ub7f0\uc2a4","permalink":"/blog/review-programmers-data-engineering-conference"}},"content":"\uc5b4\ub290\ub0a0, \ub9c1\ud06c\ub4dc\uc778 \ud53c\ub4dc\ub97c \ub458\ub7ec\ubcf4\ub358 \uc911 \uad00\uc2ec\uc774 \uac00\ub294 [\uae00](https://www.linkedin.com/feed/update/urn:li:activity:6986550988979539968/?updateEntityUrn=urn%3Ali%3Afs_feedUpdate%3A%28V2%2Curn%3Ali%3Aactivity%3A6986550988979539968%29)\uc744 \ubcf4\uc558\uc2b5\ub2c8\ub2e4. \ubc14\ub85c 2022 \uc3d8\uce74 \ub370\uc774\ud130 \ubc0b\uc5c5\uc778\ub370\uc694, \uc774\uc804\uc5d0 [\ub370\uc774\ud130 \uc5d4\uc9c0\ub2c8\uc5b4\ub9c1 \ucee8\ud37c\ub7f0\uc2a4](https://dev-owner.github.io/blog/review-programmers-data-engineering-conference)\ub97c \ub2e4\ub140\uc628 \ud6c4\ub85c \uc774\ub7f0 \uc624\ud504\ub77c\uc778 \ubc0b\uc5c5\uc5d0 \ub300\ud55c \uc774\ubbf8\uc9c0\uac00 \uc88b\uc544\uc838\uc11c \ubc14\ub85c \ub4f1\ub85d \uc2e0\uccad \ud588\uc2b5\ub2c8\ub2e4.\\n\\n![socar-meetup](../static/img/blog/2022-10-27-1.png)\\n\\n\ubc1c\ud45c \uc8fc\uc81c\ub294 \uc544\ub798\uc640 \uac19\uc558\uc2b5\ub2c8\ub2e4.\\n\\n1. \ubb34\ub824 2\ub9cc\ub300\uc758 \ucc28\ub7c9\uc744 AI\ub85c \uad00\ub9ac\ud558\ub294 \ubc29\ubc95\\n2. \ub370\uc774\ud130\ub85c \ube44\uc988\ub2c8\uc2a4 \uae09\uc18d \uc131\uc7a5 \ubd80\uc2a4\ud130 \ub2ec\uae30\\n3. \ub370\uc774\ud130\ub85c \uace0\uac1d\uacbd\ud5d8 \uac1c\uc120\ud558\uae30\\n4. \uae30\uc220\ub85c \uc3d8\uce74\uc758 \ud575\uc2ec \ube44\uc988\ub2c8\uc2a4 \ubb38\uc81c \ud574\uacb0\ud558\uae30\\n\\n![](../static/img/blog/2022-10-27-2.png)\\n\\n\uc870\uae08 \uc77c\ucc0d \ub3c4\ucc29\ud558\uc5ec \uba3c\uc800 \ub3c4\ucc29\ud558\uc2e0\ubd84\ub4e4\uacfc \uc3d8\uce74\uc5d0\uc11c \uc81c\uacf5\ud574\uc900 \uac04\ub2e8\ud55c \uc800\ub141\uac70\ub9ac\ub97c \uba39\uc73c\uba70 \ub2f4\uc18c\ub97c \ub098\ub204\uc5c8\ub294\ub370, \uc774\ubc88 \ubc0b\uc5c5 \uacbd\uc7c1\ub960\uc774 8:1\uc774\ub77c\ub294 \uc18c\ub9ac\ub97c \ub4e3\uace0 \uaf64 \ub180\ub790\uc2b5\ub2c8\ub2e4 :) \ud55c\ud3b8\uc73c\ub85c\ub294 \uc81c\uac00 \ub108\ubb34\ub3c4 \uc6b4\uc774 \uc88b\uac8c \ubf51\ud614\uad6c\ub098 \uc0dd\uac01\ub3c4 \ub4e4\uc5c8\uad6c\uc694.\\n\\n\uc0ac\uc2e4, \uc2e0\uccad \ub2f9\uc2dc\uc5d0 \ubc14\ube60\uc11c \uc8fc\uc81c\ub97c \ub300\ucda9 \ubcf4\uace0 \ub118\uc5b4\uac14\ub2e4\uac00 \ub2f9\uc77c\uc5d0 \ub3c4\ucc29\ud574\uc11c \ub300\ubd80\ubd84 `Data Science`\ucabd \uad00\ub828 \ub0b4\uc6a9\uc774\ub77c\ub294\uac83\uc744 \uae68\ub2ec\uc558\uc2b5\ub2c8\ub2e4. (\ud544\uc790\ub294 Data Engineering\ucabd\uc5d0 \uad00\uc2ec\uc774 \ub354 \ub9ce\uc558\uc2b5\ub2c8\ub2e4..) \uc5b4\uca0c\ub4e0 \ub370\uc774\ud130\ucabd \ubd84\uc57c \uc8fc\uc81c\ub294 \ubaa8\ub450 \ud765\ubbf8\ub86d\uae30 \ub54c\ubb38\uc5d0 \ud06c\uac8c \uc2e4\ub9dd\ud558\uc9c0 \uc54a\uace0 \uc138\uc158 4\uac1c\ub97c \ubaa8\ub450 \uc798 \ub4e4\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n![](../static/img/blog/2022-10-27-3.png)\\n\\n\uc138\uc158\ub4e4\uc740 \ubaa8\ub450 \uc7ac\ubc0c\uac8c \ub4e4\uc5c8\ub294\ub370 \ud3ec\uc2a4\ud305 \ubaa9\uc801\uc73c\ub85c \uac04 \uac83\uc774 \uc544\ub2c8\ub77c \ub530\ub85c \uae30\ub85d\uc744 \ud558\uc9c0 \uc54a\uc544 \uc138\ubd80\uc801\uc778 \ub0b4\uc6a9\uc744 \uacf5\uc720\ub4dc\ub9b4 \uc218\uac00 \uc5c6\uc5b4\uc11c \uc544\uc27d\uc2b5\ub2c8\ub2e4. \ub300\ub7b5\uc801\uc778 \ub290\ub08c\ub9cc \uacf5\uc720 \ub4dc\ub9ac\uc790\uba74 \ub370\uc774\ud130 \uc870\uc9c1\uc758 \ud06c\uae30\ub098 \ud558\uace0 \uc788\ub294 \uc77c\ub4e4\uc744 \ubd24\uc744 \ub54c, `\uc774 \ud68c\uc0ac \uc815\ub9d0 \ub370\uc774\ud130\uc5d0 \uc9c4\uc2ec`\uc774\uad6c\ub098\ub97c \ub290\uaf08\uc2b5\ub2c8\ub2e4. \ube44\uc988\ub2c8\uc2a4\uc5d0\uc11c \ud480\uc5b4\uc57c \ud558\ub294 \ubb38\uc81c\ub4e4\ub3c4 \ub9ce\uc740\uac83 \uac19\uace0 \uadf8\ub7ec\ud55c \ubb38\uc81c\ub4e4\uc744 \ud558\ub098\ud558\ub098 \ub370\uc774\ud130\uc5d0 \uae30\ubc18\ud558\uc5ec \uc798 \ud480\uc5b4\ub098\uac00\ub294 \uac83\uc774 \ubb54\uac00 \uc774\uc0c1\uc801\uc778 \ubaa8\uc2b5\ucc98\ub7fc \ubcf4\uc600\uc5b4\uc694.\\n\\n![](../static/img/blog/2022-10-27-4.png)\\n\\n\ub180\ub790\ub358\uac83 \uc911\uc5d0 \ud558\ub098\ub294 \uc5f0\uc0ac\ubd84\ub4e4\uc740 \ubaa8\ub450 \ud300\uc7a5\ubd84\ub4e4\uc774\uc168\ub294\ub370 \uadf8 \uc911 \ud55c\ubd84\uc774 4\ub144\uc804 \uc778\ud134\uc73c\ub85c \uc2dc\uc791\ud574\uc11c \uc9c0\uae08 \ud300\uc7a5\uc5ed\ud560\uc744 \ud558\uace0 \uc788\ub294 \ubaa8\uc2b5\uc774 \uc815\ub9d0 \uc131\uacfc \uc704\uc8fc\ub85c \uc0ac\ub78c\uc744 \ud3c9\uac00\ud55c\ub2e4\uace0 \ub290\uaf08\uc2b5\ub2c8\ub2e4. \ub180\ub78c \ud3ec\uc778\ud2b8\uac00 \ud558\ub098 \ub354 \uc788\ub294\ub370, AI\uad00\ub828\ub418\uc5b4 Lab\ucc98\ub7fc \uac01\uc885 \uc720\uba85 \uc800\ub110\uc774\ub098 \ucee8\ud37c\ub7f0\uc2a4\uc5d0 \uafb8\uc900\ud788 \ub17c\ubb38\ub3c4 \ub4f1\ub85d\ud558\uace0 \uc788\ub294\uac83\uc73c\ub85c \ubcf4\uc5ec\uc11c \uadf8\uc800 \ub3c8\ubc84\ub294\ub370\ub9cc \uc9d1\uc911\ud558\uae30\ubcf4\ub2e4 \uad6c\uc131\uc6d0\ub4e4\uc758 \ucee4\ub9ac\uc5b4\uc640 \uc5c5\uacc4\uc5d0 \uae30\uc5ec\ub97c \ud558\uace0\uc788\ub2e4\ub294 \ub290\ub08c\ub3c4 \ub9ce\uc774 \ubc1b\uc558\uc2b5\ub2c8\ub2e4.\\n\\n![](../static/img/blog/2022-10-27-5.png)\\n\\n\uc138\uc158\uc774 \ub2e4 \ub05d\ub098\uace0, \uc3d8\uce74\uce21\uc5d0\uc11c \ubc1c\ud45c \ud300\uc6d0\ubd84\ub4e4\uacfc \uc9c1\uc811\uc801\uc73c\ub85c Q&A\ub97c \ud560 \uc218 \uc788\ub294 \ubc29\uc744 \ub530\ub85c \uc7a1\uc544 \uc2dc\uac04\uc744 \ub9c8\ub828\ud574 \uc8fc\uc168\uc2b5\ub2c8\ub2e4. \uac1c\uc778\uc801\uc73c\ub85c \ub2e4\ub978\ubd84\ub4e4\uacfc \ub124\ud2b8\uc6cc\ud0b9 \uc2dc\uac04\uc774 \ub530\ub85c \uc5c6\uc5b4 \uc544\uc26c\uc6b4 \ubd80\ubd84\uc774 \uc788\uc5c8\uc9c0\ub9cc \uadf8\ub798\ub3c4 \uc3d8\uce74 \uad6c\uc131\uc6d0\ub4e4\uacfc \ub9cc\ub0a0 \uc218 \uc788\uc5b4\uc11c \uc88b\uc558\uc2b5\ub2c8\ub2e4.\\n\\n\uc800\ub294 \uc8c4\uc1a1\uc2a4\ub7fd\uac8c\ub3c4 \ubc1c\ud45c\ud574\uc8fc\uc2e0 \ud300\ub4e4\ubcf4\ub2e4 Data Engineering\ud300\uc5d0 \uad00\uc2ec\uc774 \ub9ce\uc558\ub294\ub370 \ub9c8\uce68 \ud574\ub2f9 \ud300\ub3c4 \ubc29\uc5d0\uc11c Q&A\ub97c \uc9c4\ud589\ud574 \uc8fc\uc154\uc11c \uc6b4\uc88b\uac8c \ucc38\uc11d\ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\ub4e4\uc5b4\uac00\ubcf4\ub2c8 \uc81c\uac00 \ud3c9\uc18c\uc5d0 \ud765\ubbf8\ub86d\uac8c \uc77d\uc5c8\ub358 [\ub370\uc774\ud130\uc5d0 \uc2e0\ub8b0\uc131\uacfc \uc7ac\uc0ac\uc6a9\uc131\uae4c\uc9c0, Analytics Engineering with dbt](https://tech.socarcorp.kr/data/2022/07/25/analytics-engineering-with-dbt.html)\uae00\uc758 \uc800\uc790\uc774\uc2e0 \ud5d8\ud504\ub9ac\ub2d8\uc774 \ud574\ub2f9 \ud300\uc758 \ud300\uc7a5 \uc785\uc7a5\uc73c\ub85c \uacc4\uc154\uc11c \uaf64\ub098 \ub180\ub790\uc2b5\ub2c8\ub2e4. \uc778\uc0ac\ub97c \ub098\ub204\uace0, \uc81c\uac00 \uc77c\ud558\uba74\uc11c \uad81\uae08\ud588\ub358 \uc810\ub4e4\uc744 \uba87\uac00\uc9c0 \uc9c8\ubb38\ud588\ub294\ub370 \uc815\ub9d0 \uc2dc\uac04\uc774 \uae08\ubc29 \uac00\ub354\ub77c\uad6c\uc694. \ub2e4\ub978\ubd84\ub4e4 \uc9c8\ubb38\ub4e4\ub3c4 \uc7ac\ubbf8\uc788\uc5c8\uace0 \uc815\ub9d0 \uc720\uc775\ud55c \uc2dc\uac04\uc774\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc774\ub807\uac8c \ud300\uc6d0\ubd84\ub4e4\uacfc \ubbf8\ud305\uae4c\uc9c0 \ub05d\ub098\ub2c8 \uc5b4\ub290\ub367 10\uc2dc\uac00 \ub118\uc5b4 \uc9d1\uc73c\ub85c \uac00\ub294\ub370 \uac19\uc740 \ubc29\uc5d0\uc11c Q&A\ub97c \ud558\uc2dc\ub358 \ubd84\uacfc \uc9c0\ud558\ucca0\uc5ed\uae4c\uc9c0 \uac78\uc5b4\uac00\uba74\uc11c \ub354 \uc774\uc57c\uae30\ub97c \ud560 \uc815\ub3c4\ub85c \ub2e4\ub978 \ucc38\uc11d\ud558\uc2e0\ubd84\ub4e4\ub3c4 \uc5f4\uc815\uc774 \ub300\ub2e8\ud558\uc168\ub358\uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n\ud3c9\uc18c \ubc16\uc744 \ub098\uac00\uc9c0 \uc54a\ub294 \uc131\uaca9\uc774\ub77c \uc774\ub7f0 \uc624\ud504\ub77c\uc778 \ubc0b\uc5c5\uc744 \uc120\ud638\ud558\uc9c0 \uc54a\uc558\ub294\ub370 2\ud68c\ucc28 \ubc0b\uc5c5\ub3c4 \uc88b\uc740 \uc778\uc0c1\uc73c\ub85c \ub0a8\uc544 \uc55e\uc73c\ub85c \uc810\uc810 \ub354 \ub9ce\uc774 \uae30\uc6c3\uac70\ub9b4\uac83 \uac19\ub124\uc694!"}]}')}}]);